import React from 'react'

const Section = styled.section`
  width: 100vw;
  height: 105vh;
  position: relative;

  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  align-items: center;

  background-color: var(--white);
  overflow: hidden;
`;

function AboutPage() {
  return (
    <div>AboutPage</div>
  )
}

export default AboutPage
